			want: "abc",
		},
		{
			name: "leading whitespace",
			args: args{
				s: "  abc",
			},
			want: "abc",
		},
		{
			name: "trailing whitespace",
			args: args{
				s: "abc  ",
			},
			want: "abc  ",
