package fastjson

import (
	"fmt"
	"testing"
)

func TestParseRawNumber(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name    string
		args    args
		wantNs  string
		wantS   string
		wantErr bool
	}{
		{
			name: "simple integer",
			args: args{
				s: "123",
			},
			wantNs:  "123",
			wantS:   "",
			wantErr: false,
		},
		{
			name: "simple float",
			args: args{
				s: "123.456",
			},
			wantNs:  "123.456",
			wantS:   "",
			wantErr: false,
		},
		{
			name: "negative number",
			args: args{
				s: "-123.456",
			},
			wantNs:  "-123.456",
			wantS:   "",
			wantErr: false,
		},
		{
			name: "number with exponent",
			args: args{
				s: "1.23e+4",
			},
			wantNs:  "1.23e+4",
			wantS:   "",
			wantErr: false,
		},
		{
			name: "number with exponent E",
			args: args{
				s: "1.23E-4",
			},
			wantNs:  "1.23E-4",
			wantS:   "",
			wantErr: false,
		},
		{
			name: "inf",
			args: args{
				s: "inf",
			},
			wantNs:  "inf",
			wantS:   "",
			wantErr: false,
		},
		{
			name: "INF",
			args: args{
				s: "INF",
			},
			wantNs:  "INF",
			wantS:   "",
			wantErr: false,
		},
		{
			name: "nan",
			args: args{
				s: "nan",
			},
			wantNs:  "nan",
			wantS:   "",
			wantErr: false,
		},
		{
			name: "NAN",
			args: args{
				s: "NAN",
			},
			wantNs:  "NAN",
			wantS:   "",
			wantErr: false,
		},
		{
			name: "empty string",
			args: args{
				s: "",
			},
			wantNs:  "",
			wantS:   "",
			wantErr: true,
		},
		{
			name: "invalid number",
			args: args{
				s: "123abc",
			},
			wantNs:  "123",
			wantS:   "abc",
			wantErr: false,
		},
		{
			name: "invalid number with special characters",
			args: args{
				s: "123.456!",
			},
			wantNs:  "123.456",
			wantS:   "!",
			wantErr: false,
		},
		{
			name: "invalid number with leading whitespace",
			args: args{
				s: " 123",
			},
			wantNs:  "",
			wantS:   " 123",
			wantErr: true,
		},
		{
			name: "invalid number with trailing whitespace",
			args: args{
				s: "123 ",
			},
			wantNs:  "123",
			wantS:   " ",
			wantErr: false,
		},
		{
			name: "invalid number with leading +",
			args: args{
				s: "+123",
			},
			wantNs:  "",
			wantS:   "+123",
			wantErr: true,
		},
		{
			name: "invalid number with leading -",
			args: args{
				s: "-123",
			},
			wantNs:  "-123",
			wantS:   "",
			wantErr: false,
		},
		{
			name: "invalid number with leading -, but with sign",
			args: args{
				s: "-123-",
			},
			wantNs:  "-123",
			wantS:   "-",
			wantErr: false,
		},
		{
			name: "invalid number with leading +",
			args: args{
				s: "+123+",
			},
			wantNs:  "+123",
			wantS:   "+",
			wantErr: false,
		},
		{
			name: "invalid number with leading + and trailing +",
			args: args{
				s: "+123+",
			},
			wantNs:  "+123",
			wantS:   "+",
			wantErr: false,
		},
		{
			name: "invalid number with leading - and trailing -",
			args: args{
				s: "-123-",
			},
			wantNs:  "-123",
			wantS:   "-",
			wantErr: false,
		},
		{
			name: "invalid number with leading - and trailing +",
			args: args{
				s: "-123+",
			},
			wantNs:  "-123",
			wantS:   "+",
			wantErr: false,
		},
		{
			name: "invalid number with leading + and trailing -",
			args: args{
				s: "+123-",
			},
			wantNs:  "+123",
			wantS:   "-",
			wantErr: false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			gotNs, gotS, err := parseRawNumber(tt.args.s)
			if (err != nil) != tt.wantErr {
				t.Errorf("parseRawNumber() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if gotNs != tt.wantNs {
				t.Errorf("parseRawNumber() gotNs = %v, want %v", gotNs, tt.wantNs)
			}
			if gotS != tt.wantS {
				t.Errorf("parseRawNumber() gotS = %v, want %v", gotS, tt.wantS)
			}
		})
	}
}

