package fastjson

import (
	"testing"
)

func TestParseArray(t *testing.T) {
	type args struct {
		s    string
		c    *cache
		depth int
	}
	tests := []struct {
		name    string
		args    args
		want    *Value
		want1   string
		wantErr bool
	}{
		{
			name: "empty array",
			args: args{
				s:    "[]",
				c:    &cache{vs: make([]Value, 0)},
				depth: 0,
			},
			want:    &Value{t: TypeArray, a: []*Value{}},
			want1:   "",
			wantErr: false,
		},
		{
			name: "single element array",
			args: args{
				s:    "[1]",
				c:    &cache{vs: make([]Value, 0)},
				depth: 0,
			},
			want:    &Value{t: TypeArray, a: []*Value{&Value{t: TypeNumber, s: "1"}}},
			want1:   "",
			wantErr: false,
		},
		{
			name: "multiple element array",
			args: args{
				s:    "[1,2,3]",
				c:    &cache{vs: make([]Value, 0)},
				depth: 0,
			},
			want:    &Value{t: TypeArray, a: []*Value{&Value{t: TypeNumber, s: "1"}, &Value{t: TypeNumber, s: "2"}, &Value{t: TypeNumber, s: "3"}}},
			want1:   "",
			wantErr: false,
		},
		{
			name: "nested array",
			args: args{
				s:    "[[1,2],[3,4]]",
				c:    &cache{vs: make([]Value, 0)},
				depth: 0,
			},
			want: &Value{t: TypeArray, a: []*Value{
				&Value{t: TypeArray, a: []*Value{
					&Value{t: TypeNumber, s: "1"},
					&Value{t: TypeNumber, s: "2"},
				}},
				&Value{t: TypeArray, a: []*Value{
					&Value{t: TypeNumber, s: "3"},
					&Value{t: TypeNumber, s: "4"},
				}},
			}},
			want1:   "",
			wantErr: false,
		},
		{
			name: "array with string",
			args: args{
				s:    "[\"hello\", \"world\"]",
				c:    &cache{vs: make([]Value, 0)},
				depth: 0,
			},
			want: &Value{t: TypeArray, a: []*Value{
				&Value{t: TypeString, s: "hello"},
				&Value{t: TypeString, s: "world"},
			}},
			want1:   "",
			wantErr: false,
		},
		{
			name: "array with invalid value",
			args: args{
				s:    "[1,2,3,",
				c:    &cache{vs: make([]Value, 0)},
				depth: 0,
			},
			want:    nil,
			want1:   "[1,2,3,",
			wantErr: true,
		},
		{
			name: "array with missing closing bracket",
			args: args{
				s:    "[1,2,3",
				c:    &cache{vs: make([]Value, 0)},
				depth: 0,
			},
			want:    nil,
			want1:   "[1,2,3",
			wantErr: true,
		},
		{
			name: "array with unexpected end of array",
			args: args{
				s:    "[1,2,3",
				c:    &cache{vs: make([]Value, 0)},
				depth: 0,
			},
			want:    nil,
			want1:   "[1,2,3",
			wantErr: true,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, got1, err := parseArray(tt.args.s, tt.args.c, tt.args.depth)
			if (err != nil) != tt.wantErr {
				t.Errorf("parseArray() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if !reflect.DeepEqual(got, tt.want) {
				t.Errorf("parseArray() got = %v, want %v", got, tt.want)
			}
			if got1 != tt.want1 {
				t.Errorf("parseArray() got1 = %v, want %v", got1, tt.want1)
			}
		})
	}
}

