package fastjson

import (
	"testing"
	"strconv"
	"unicode/utf16"
)

func TestUnescapeStringBestEffort(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want string
	}{
		{
			name: "empty string",
			args: args{s: ""},
			want: "",
		},
		{
			name: "no escape sequences",
			args: args{s: "abcdefg"},
			want: "abcdefg",
		},
		{
			name: "escaped quote",
			args: args{s: "\\\""},
			want: "\"",
		},
		{
			name: "escaped backslash",
			args: args{s: "\\\\"},
			want: "\\",
		},
		{
			name: "escaped slash",
			args: args{s: "\\/"},
			want: "/",
		},
		{
			name: "escaped backspace",
			args: args{s: "\\b"},
			want: "\b",
		},
		{
			name: "escaped form feed",
			args: args{s: "\\f"},
			want: "\f",
		},
		{
			name: "escaped newline",
			args: args{s: "\\n"},
			want: "\n",
		},
		{
			name: "escaped carriage return",
			args: args{s: "\\r"},
			want: "\r",
		},
		{
			name: "escaped tab",
			args: args{s: "\\t"},
			want: "\t",
		},
		{
			name: "escaped unicode",
			args: args{s: "\\u0061"},
			want: "a",
		},
		{
			name: "escaped unicode surrogate pair",
			args: args{s: "\\uD83D\\uDE00"},
			want: string(utf16.DecodeRune(0xD83D, 0xDE00)),
		},
		{
			name: "invalid escape sequence",
			args: args{s: "\\u00"},
			want: "\\u00",
		},
		{
			name: "multiple escape sequences",
			args: args{s: "\\\"\\b\\f\\n\\r\\t\\u0061\\uD83D\\uDE00\\u00"},
			want: "\"\\b\f\n\r\ta" + string(utf16.DecodeRune(0xD83D, 0xDE00)) + "\\u00",
		},
		{
			name: "escape sequence at the beginning",
			args: args{s: "\\\"abcdefg"},
			want: "\"abcdefg",
		},
		{
			name: "escape sequence at the end",
			args: args{s: "abcdefg\\\""},
			want: "abcdefg\"",
		},
		{
			name: "escape sequence in the middle",
			args: args{s: "abc\\\"defg"},
			want: "abc\"defg",
		},
		{
			name: "escaped unicode with incomplete surrogate pair",
			args: args{s: "\\uD83D\\u"},
			want: "\\uD83D\\u",
		},
		{
			name: "escaped unicode with invalid surrogate pair",
			args: args{s: "\\uD83D\\uDE01"},
			want: "\\uD83D\\uDE01",
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := unescapeStringBestEffort(tt.args.s); got != tt.want {
				t.Errorf("unescapeStringBestEffort() = %v, want %v", got, tt.want)
			}
		})
	}
}

