			args: args{
				s: "false",
			},
			want: &Value{
				t: TypeFalse,
			},
			wantErr: false,
		},
		{
			name: "parse string",
			args: args{
				s: `"hello"`,
			},
			want: &Value{
				t:  TypeString,
				s: "hello",
			},
			wantErr: false,
		},
		{
			name: "parse number",
			args: args{
				s: "123",
			},
			want: &Value{
				t: TypeNumber,
				s: "123",
			},
			wantErr: false,
		},
		{
			name: "parse object",
			args: args{
				s: `{"a": 1, "b": "2"}`,
			},
			want: &Value{
				t: TypeObject,
				o: Object{
					kvs: []kv{
						{
							k: "a",
							v: &Value{
								t: TypeNumber,
								s: "1",
							},
						},
						{
							k: "b",
							v: &Value{
								t:  TypeString,
								s: "2",
							},
						},
					},
				},
			},
			wantErr: false,
		},
		{
			name: "parse array",
			args: args{
				s: `[1, "2", true]`,
			},
			want: &Value{
				t: TypeArray,
				a: []*Value{
					{
						t: TypeNumber,
						s: "1",
					},
					{
						t:  TypeString,
						s: "2",
					},
					{
						t: TypeTrue,
					},
				},
			},
			wantErr: false,
		},
		{
			name: "parse invalid json",
			args: args{
				s: `{`,
			},
			want:    nil,
			wantErr: true,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			p := &Parser{}
			got, err := p.Parse(tt.args.s)
			if (err != nil) != tt.wantErr {
				t.Errorf("Parse() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if !tt.wantErr {
				if !compareValues(got, tt.want) {
					t.Errorf("Parse() = %v, want %v", got, tt.want)
				}
			}
		})
	}
}

func compareValues(v1, v2 *Value) bool {
	if v1.t != v2.t {
		return false
	}
	switch v1.t {
	case TypeNull:
		return true
	case TypeTrue:
		return true
	case TypeFalse:
		return true
	case TypeString:
		return v1.s == v2.s
	case TypeNumber:
		return v1.s == v2.s
	case TypeObject:
		if len(v1.o.kvs) != len(v2.o.kvs) {
			return false
		}
		for i, kv1 := range v1.o.kvs {
			kv2 := v2.o.kvs[i]
			if kv1.k != kv2.k {
				return false
			}
			if !compareValues(kv1.v, kv2.v) {
				return false
			}
		}
		return true
	case TypeArray:
		if len(v1.a) != len(v2.a) {
			return false
		}
		for i, v1 := range v1.a {
			if !compareValues(v1, v2.a[i]) {
				return false
			}
		}
		return true
	}
	return false
}

