		{
			name: "object",
			args: args{
				s:    "{\"a\": 1}",
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					o: Object{
						kvs: []kv{
							{
								k: "a",
								v: &Value{
									t: TypeNumber,
									s: "1",
								},
							},
						},
					},
