				s:    "[1, 2, 3]",
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					a: []*Value{
						{
							t: TypeNumber,
							s: "1",
						},
						{
							t: TypeNumber,
							s: "2",
						},
						{
							t: TypeNumber,
							s: "3",
						},
					},
					t: TypeArray,
				},
				tail: "",
				err:  nil,
			},
		},
		{
			name: "string",
			args: args{
				s:    "\"hello\"",
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: typeRawString,
					s: "hello",
				},
				tail: "",
				err:  nil,
			},
		},
		{
			name: "true",
			args: args{
				s:    "true",
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v:   valueTrue,
				tail: "",
				err:  nil,
			},
