			name: "false",
			args: args{
				s:    "false",
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v:   valueFalse,
				tail: "",
				err:  nil,
			},
		},
		{
			name: "null",
			args: args{
				s:    "null",
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v:   valueNull,
				tail: "",
				err:  nil,
			},
		},
		{
			name: "number",
			args: args{
				s:    "123",
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeNumber,
					s: "123",
				},
				tail: "",
				err:  nil,
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			gotV, gotTail, gotErr := parseValue(tt.args.s, tt.args.c, tt.args.depth)
			if !jsonEqual(t, gotErr, tt.want.err) {
				return
			}
			if !jsonEqual(t, gotV, tt.want.v) {
				return
			}
			if gotTail != tt.want.tail {
				t.Errorf("parseValue() gotTail = %v, want %v", gotTail, tt.want.tail)
			}
		})
	}
}

func jsonEqual(t *testing.T, a, b interface{}) bool {
	aJSON, err := json.Marshal(a)
	if err != nil {
		t.Errorf("json.Marshal(a) error: %v", err)
		return false
	}
	bJSON, err := json.Marshal(b)
	if err != nil {
		t.Errorf("json.Marshal(b) error: %v", err)
		return false
	}
	return string(aJSON) == string(bJSON)
}

