			args: args{s: "hello world"},
			want: "hello world",
		},
		{
			name: "escaped quotes",
			args: args{s: "\\\"hello\\\" world"},
			want: "\"hello\" world",
		},
		{
			name: "escaped backslashes",
			args: args{s: "\\\\hello\\\\ world"},
			want: "\\hello\\ world",
		},
		{
			name: "escaped forward slashes",
			args: args{s: "\\/hello\\/ world"},
			want: "/hello/ world",
		},
		{
			name: "escaped backspace",
			args: args{s: "\\bhello\\b world"},
			want: "\bhello\b world",
		},
		{
			name: "escaped form feed",
			args: args{s: "\\fhello\\f world"},
			want: "\fhello\f world",
		},
		{
			name: "escaped newline",
			args: args{s: "\\nhello\\n world"},
			want: "\nhello\n world",
		},
		{
			name: "escaped carriage return",
			args: args{s: "\\rhello\\r world"},
			want: "\rhello\r world",
		},
		{
			name: "escaped tab",
			args: args{s: "\\thello\\t world"},
			want: "\thello\t world",
		},
		{
			name: "escaped unicode character",
			args: args{s: "\\u0061hello\\u0062 world"},
			want: "ahello b world",
		},
		{
			name: "escaped surrogate pair",
			args: args{s: "\\uD83D\\uDE01hello\\uD83D\\uDE02 world"},
			want: "üòÄhelloüòÅ world",
		},
		{
			name: "invalid escape sequence",
			args: args{s: "\\xhello\\x world"},
			want: "\\xhello\\x world",
		},
		{
			name: "short escape sequence",
			args: args{s: "\\uhello world"},
			want: "\\uhello world",
		},
		{
			name: "escaped surrogate pair with invalid second part",
			args: args{s: "\\uD83D\\uDE01hello\\uD83D\\uDE world"},
			want: "\\uD83D\\uDE01hello\\uD83D\\uDE world",
		},
		{
			name: "escaped surrogate pair with missing second part",
			args: args{s: "\\uD83D\\uDE01hello world"},
			want: "\\uD83D\\uDE01hello world",
		},
		{
			name: "escaped character with missing backslash",
			args: args{s: "hello\\ world"},
			want: "hello\\ world",
		},
	}
	for _, tt := range tests {
