	t.Run("EmptyCache", func(t *testing.T) {
		c := &cache{}
		v := c.getValue()
		if v == nil {
			t.Errorf("getValue() returned nil for empty cache")
		}
	})

	t.Run("NonEmptyCache", func(t *testing.T) {
		c := &cache{vs: []Value{{t: TypeNull}}}
		v := c.getValue()
		if v == nil {
			t.Errorf("getValue() returned nil for non-empty cache")
		}
		if v.t != TypeNull {
			t.Errorf("getValue() returned value with unexpected type: got %v, want %v", v.t, TypeNull)
		}
	})

	t.Run("CapacityGreaterThanLength", func(t *testing.T) {
		c := &cache{vs: make([]Value, 1, 3)}
		v := c.getValue()
		if v == nil {
			t.Errorf("getValue() returned nil for cache with capacity > length")
		}
		if v.t != TypeNull {
			t.Errorf("getValue() returned value with unexpected type: got %v, want %v", v.t, TypeNull)
		}
		if len(c.vs) != 2 {
			t.Errorf("getValue() did not extend the slice to length + 2")
		}
	})
}

