}

func compareValues(got, want *Value) bool {
	if got.t != want.t {
		return false
	}
	switch got.t {
	case TypeNull:
		return true
	case TypeTrue:
		return true
	case TypeFalse:
		return true
	case TypeString:
		return got.s == want.s
	case TypeNumber:
		return got.s == want.s
	case TypeArray:
		if len(got.a) != len(want.a) {
			return false
		}
		for i := range got.a {
			if !compareValues(got.a[i], want.a[i]) {
				return false
			}
		}
		return true
	case TypeObject:
		if len(got.o.kvs) != len(want.o.kvs) {
			return false
		}
		for i := range got.o.kvs {
			if got.o.kvs[i].k != want.o.kvs[i].k {
				return false
			}
			if !compareValues(got.o.kvs[i].v, want.o.kvs[i].v) {
				return false
			}
		}
		return true
	}
	return false
}

