func TestParseObject(t *testing.T) {
	type args struct {
		s    string
		c    *cache
		depth int
	}
	tests := []struct {
		name    string
		args    args
		want    *Value
		want1   string
		wantErr bool
	}{
		{
			name: "Empty object",
			args: args{
				s:    "{}",
				c:    &cache{},
				depth: 0,
			},
			want: &Value{
				t: TypeObject,
				o: Object{
					kvs:           nil,
					keysUnescaped: false,
				},
			},
			want1:   "",
			wantErr: false,
		},
		{
			name: "Single key-value pair",
			args: args{
				s:    `{"key": "value"}`,
				c:    &cache{},
				depth: 0,
			},
			want: &Value{
				t: TypeObject,
				o: Object{
					kvs: []kv{
						{
							k: "key",
							v: &Value{
								t: TypeString,
								s: "value",
							},
						},
					},
					keysUnescaped: false,
				},
			},
			want1:   "",
			wantErr: false,
		},
		{
			name: "Multiple key-value pairs",
			args: args{
				s:    `{"key1": "value1", "key2": "value2"}`,
				c:    &cache{},
				depth: 0,
			},
			want: &Value{
				t: TypeObject,
				o: Object{
					kvs: []kv{
						{
							k: "key1",
							v: &Value{
								t: TypeString,
								s: "value1",
							},
						},
						{
							k: "key2",
							v: &Value{
								t: TypeString,
								s: "value2",
							},
						},
					},
					keysUnescaped: false,
				},
			},
			want1:   "",
			wantErr: false,
		},
		{
			name: "Nested object",
			args: args{
				s:    `{"key1": {"key2": "value2"}}`,
				c:    &cache{},
				depth: 0,
			},
			want: &Value{
				t: TypeObject,
				o: Object{
					kvs: []kv{
						{
							k: "key1",
							v: &Value{
								t: TypeObject,
								o: Object{
									kvs: []kv{
										{
											k: "key2",
											v: &Value{
												t: TypeString,
												s: "value2",
											},
										},
									},
									keysUnescaped: false,
								},
							},
						},
					},
					keysUnescaped: false,
				},
			},
			want1:   "",
			wantErr: false,
		},
		{
			name: "Missing closing brace",
			args: args{
				s:    `{"key": "value"`,
				c:    &cache{},
				depth: 0,
			},
			want:    nil,
			want1:   `{"key": "value"`,
			wantErr: true,
		},
		{
			name: "Missing colon",
			args: args{
				s:    `{"key" "value"}`,
				c:    &cache{},
				depth: 0,
			},
			want:    nil,
			want1:   `{"key" "value"}`,
			wantErr: true,
		},
		{
			name: "Missing comma",
			args: args{
				s:    `{"key1": "value1" "key2": "value2"}`,
				c:    &cache{},
				depth: 0,
			},
			want:    nil,
			want1:   `{"key1": "value1" "key2": "value2"}`,
			wantErr: true,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, got1, err := parseObject(tt.args.s, tt.args.c, tt.args.depth)
			if (err != nil) != tt.wantErr {
				t.Errorf("parseObject() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if !reflect.DeepEqual(got, tt.want) {
				t.Errorf("parseObject() got = %v, want %v", got, tt.want)
			}
			if got1 != tt.want1 {
				t.Errorf("parseObject() got1 = %v, want %v", got1, tt.want1)
			}
		})
	}
}

