							t: TypeString,
							s: "value1",
						},
						{
							t: TypeString,
							s: "value2",
						},
					},
				},
				tail: "",
				err:  nil,
			},
		},
		{
			name: "string",
			args: args{
				s:   `"value"`,
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeString,
					s: "value",
				},
				tail: "",
				err:  nil,
			},
		},
		{
			name: "true",
			args: args{
				s:   `true`,
				c:   &cache{},
				depth: 0,
