				depth: 0,
			},
			want: want{
				v:   valueNull,
				tail: "",
				err:  nil,
			},
		},
		{
			name: "number",
			args: args{
				s:   `123`,
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeNumber,
					s: "123",
				},
				tail: "",
				err:  nil,
			},
		},
		{
			name: "NaN",
			args: args{
				s:   `NaN`,
				c:   &cache{},
				depth: 0,
			},
			want: want{
