					t: TypeNumber,
					s: "NaN",
				},
				tail: "",
				err:  nil,
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			gotV, gotTail, gotErr := parseValue(tt.args.s, tt.args.c, tt.args.depth)
			if (gotErr != nil && tt.want.err == nil) || (gotErr == nil && tt.want.err != nil) {
				t.Errorf("parseValue() error = %v, wantErr %v", gotErr, tt.want.err)
				return
			}
			if gotErr != nil && tt.want.err != nil {
				if gotErr.Error() != tt.want.err.Error() {
					t.Errorf("parseValue() error = %v, wantErr %v", gotErr, tt.want.err)
					return
				}
			}
			if gotTail != tt.want.tail {
				t.Errorf("parseValue() gotTail = %v, want %v", gotTail, tt.want.tail)
			}
			if !compareValues(gotV, tt.want.v) {
				t.Errorf("parseValue() gotV = %v, want %v", gotV, tt.want.v)
			}
		})
	}
}

func compareValues(v1, v2 *Value) bool {
	if v1 == nil && v2 == nil {
		return true
	}
	if v1 == nil || v2 == nil {
		return false
	}
	if v1.t != v2.t {
		return false
	}
	switch v1.t {
	case TypeObject:
		if len(v1.o.kvs) != len(v2.o.kvs) {
			return false
		}
		for i := range v1.o.kvs {
			if v1.o.kvs[i].k != v2.o.kvs[i].k || !compareValues(v1.o.kvs[i].v, v2.o.kvs[i].v) {
				return false
			}
		}
	case TypeArray:
		if len(v1.a) != len(v2.a) {
			return false
		}
		for i := range v1.a {
			if !compareValues(v1.a[i], v2.a[i]) {
				return false
			}
		}
	case TypeString, TypeNumber:
		if v1.s != v2.s {
			return false
		}
	case TypeTrue, TypeFalse, TypeNull:
		// no need to compare anything
	default:
		return false
	}
	return true
}

