package fastjson

import (
	"fmt"
	"testing"
)

func TestParseObject(t *testing.T) {
	type args struct {
		s    string
		c    *cache
		depth int
	}
	type want struct {
		v   *Value
		s   string
		err error
	}
	tests := []struct {
		name string
		args args
		want want
	}{
		{
			name: "empty object",
			args: args{
				s:    "{}",
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeObject,
					o: Object{
						kvs:           nil,
						keysUnescaped: false,
					},
				},
				s:   "",
				err: nil,
			},
		},
		{
			name: "single key-value pair",
			args: args{
				s:    `{"key": "value"}`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeObject,
					o: Object{
						kvs: []kv{
							{
								k: "key",
								v: &Value{
									t: TypeString,
									s: "value",
								},
							},
						},
						keysUnescaped: false,
					},
				},
				s:   "",
				err: nil,
			},
		},
		{
			name: "multiple key-value pairs",
			args: args{
				s:    `{"key1": "value1", "key2": "value2"}`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeObject,
					o: Object{
						kvs: []kv{
							{
								k: "key1",
								v: &Value{
									t: TypeString,
									s: "value1",
								},
							},
							{
								k: "key2",
								v: &Value{
									t: TypeString,
									s: "value2",
								},
							},
						},
						keysUnescaped: false,
					},
				},
				s:   "",
				err: nil,
			},
		},
		{
			name: "nested object",
			args: args{
				s:    `{"key1": {"key2": "value2"}}`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeObject,
					o: Object{
						kvs: []kv{
							{
								k: "key1",
								v: &Value{
									t: TypeObject,
									o: Object{
										kvs: []kv{
											{
												k: "key2",
												v: &Value{
													t: TypeString,
													s: "value2",
												},
											},
										},
										keysUnescaped: false,
									},
								},
							},
						},
						keysUnescaped: false,
					},
				},
				s:   "",
				err: nil,
			},
		},
		{
			name: "missing closing brace",
			args: args{
				s:    `{"key": "value"`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v:   nil,
				s:   `{"key": "value"`,
				err: fmt.Errorf("missing '}'"),
			},
		},
		{
			name: "missing key",
			args: args{
				s:    `{:"value"}`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v:   nil,
				s:   `{:"value"}`,
				err: fmt.Errorf(`cannot find opening '"" for object key`),
			},
		},
		{
			name: "missing colon",
			args: args{
				s:    `{"key" "value"}`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v:   nil,
				s:   `{"key" "value"}`,
				err: fmt.Errorf("missing ':' after object key"),
			},
		},
		{
			name: "missing comma",
			args: args{
				s:    `{"key1": "value1" "key2": "value2"}`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v:   nil,
				s:   `{"key1": "value1" "key2": "value2"}`,
				err: fmt.Errorf("missing ',' after object value"),
			},
		},
		{
			name: "unexpected end of object",
			args: args{
				s:    `{"key": "value`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v:   nil,
				s:   `{"key": "value`,
				err: fmt.Errorf("unexpected end of object"),
			},
		},
		{
			name: "invalid key",
			args: args{
				s:    `{"key": "value", "key2: "value2"}`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v:   nil,
				s:   `{"key": "value", "key2: "value2"}`,
				err: fmt.Errorf("cannot parse object key: cannot parse key: missing closing quote"),
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			gotV, gotS, gotErr := parseObject(tt.args.s, tt.args.c, tt.args.depth)
			if gotErr != nil && tt.want.err == nil {
				t.Errorf("parseObject() error = %v, want nil", gotErr)
				return
			}
			if gotErr == nil && tt.want.err != nil {
				t.Errorf("parseObject() error = nil, want %v", tt.want.err)
				return
			}
			if gotErr != nil && tt.want.err != nil && gotErr.Error() != tt.want.err.Error() {
				t.Errorf("parseObject() error = %v, want %v", gotErr, tt.want.err)
				return
			}
			if !reflect.DeepEqual(gotV, tt.want.v) {
				t.Errorf("parseObject() gotV = %v, want %v", gotV, tt.want.v)
			}
			if gotS != tt.want.s {
				t.Errorf("parseObject() gotS = %v, want %v", gotS, tt.want.s)
			}
		})
	}
}

