		args args
		want string
	}{
		{
			name: "empty string",
			args: args{s: ""},
			want: "",
		},
		{
			name: "no escape sequences",
			args: args{s: "hello world"},
			want: "hello world",
		},
		{
			name: "escaped quotes",
			args: args{s: "\\\"hello\\\" world"},
			want: "\"hello\" world",
		},
		{
			name: "escaped backslashes",
			args: args{s: "\\\\hello\\\\ world"},
			want: "\\hello\\ world",
		},
		{
			name: "escaped forward slashes",
			args: args{s: "\\/hello\\/ world"},
			want: "/hello/ world",
		},
		{
			name: "escaped backspace",
			args: args{s: "\\bhello\\b world"},
			want: "\bhello\b world",
		},
		{
			name: "escaped form feed",
			args: args{s: "\\fhello\\f world"},
			want: "\fhello\f world",
		},
		{
			name: "escaped newline",
			args: args{s: "\\nhello\\n world"},
			want: "\nhello\n world",
		},
		{
			name: "escaped carriage return",
			args: args{s: "\\rhello\\r world"},
			want: "\rhello\r world",
		},
		{
			name: "escaped tab",
			args: args{s: "\\thello\\t world"},
			want: "\thello\t world",
		},
		{
			name: "escaped unicode",
			args: args{s: "\\u0061\\u0062\\u0063"},
			want: "abc",
		},
		{
			name: "escaped surrogate pair",
			args: args{s: "\\uD83D\\uDE01"},
			want: "üòÄ",
		},
		{
			name: "invalid escape sequence",
			args: args{s: "\\u0061\\u0062\\x"},
			want: "\\u0061\\u0062\\x",
		},
		{
			name: "too short escape sequence",
			args: args{s: "\\u0061\\u0062\\u"},
			want: "\\u0061\\u0062\\u",
		},
		{
			name: "multiple escape sequences",
			args: args{s: "\\\"hello\\\" \\\\world\\\\ \\/\\b\\f\\n\\r\\t\\u0061\\u0062\\u0063\\uD83D\\uDE01\\x"},
			want: "\"hello\" \\world\\ /\\b\\f\\n\\r\tabcüòÄ\\x",
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
