				c:   &cache{},
				depth: 0,
			},
			want: want{
				v:   nil,
				s:   `{"key1" "value1", "key2": "value2"}`,
				err: fmt.Errorf("missing ':' after object key"),
			},
		},
		{
			name: "Invalid Key",
			args: args{
				s:   `{"key1": "value1", "key2": "value2`,
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v:   nil,
				s:   `{"key1": "value1", "key2": "value2`,
				err: fmt.Errorf("missing '}'"),
			},
		},
		{
			name: "Invalid Value",
			args: args{
				s:   `{"key1": value1, "key2": "value2"}`,
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v:   nil,
				s:   `{"key1": value1, "key2": "value2"}`,
				err: fmt.Errorf("cannot parse object value: unexpected end of JSON input"),
			},
		},
		{
			name: "Missing Comma",
			args: args{
				s:   `{"key1": "value1" "key2": "value2"}`,
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v:   nil,
				s:   `{"key1": "value1" "key2": "value2"}`,
				err: fmt.Errorf("missing ',' after object value"),
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			gotV, gotS, gotErr := parseObject(tt.args.s, tt.args.c, tt.args.depth)
			if gotErr != nil {
				if tt.want.err == nil {
					t.Errorf("parseObject() error = %v, want nil", gotErr)
					return
				}
				if !json.Valid([]byte(gotS)) {
					t.Errorf("parseObject() unexpected remaining string: %q, want valid json string", gotS)
				}
				if gotErr.Error() != tt.want.err.Error() {
					t.Errorf("parseObject() error = %v, want %v", gotErr, tt.want.err)
					return
				}
			}
			if tt.want.err == nil && gotErr != nil {
				t.Errorf("parseObject() error = %v, want nil", gotErr)
				return
			}
			if gotV != nil {
				if tt.want.v == nil {
					t.Errorf("parseObject() = %v, want nil", gotV)
					return
				}
				if !compareValues(gotV, tt.want.v) {
					t.Errorf("parseObject() got = %v, want %v", gotV, tt.want.v)
				}
			} else {
				if tt.want.v != nil {
					t.Errorf("parseObject() = nil, want %v", tt.want.v)
				}
			}
			if gotS != tt.want.s {
				t.Errorf("parseObject() gotS = %q, want %q", gotS, tt.want.s)
			}
		})
	}
}

func compareValues(v1, v2 *Value) bool {
	if v1.t != v2.t {
		return false
	}
	switch v1.t {
	case TypeObject:
		if len(v1.o.kvs) != len(v2.o.kvs) {
			return false
		}
		for i := range v1.o.kvs {
			if v1.o.kvs[i].k != v2.o.kvs[i].k {
				return false
			}
			if !compareValues(v1.o.kvs[i].v, v2.o.kvs[i].v) {
				return false
			}
		}
	case TypeArray:
		if len(v1.a) != len(v2.a) {
			return false
		}
		for i := range v1.a {
			if !compareValues(v1.a[i], v2.a[i]) {
				return false
			}
		}
	case TypeString:
		if v1.s != v2.s {
			return false
		}
	}
	return true
}

