func TestParseValue_withCache(t *testing.T) {
	c := &cache{}
	// Allocate a few values in the cache
	for i := 0; i < 10; i++ {
		c.getValue()
	}

	// Parse a JSON string that will use values from the cache
	s := `{"key1": "value1", "key2": 2}`
	v, tail, err := parseValue(s, c, 0)

	// Check that the parsing was successful
	if err != nil {
		t.Errorf("parseValue() error = %v", err)
	}

	// Check that the returned value is correct
	if v == nil {
		t.Errorf("parseValue() returned nil value")
	}

	// Check that the tail is empty
	if tail != "" {
		t.Errorf("parseValue() returned non-empty tail: %s", tail)
	}

	// Check that the cache has been used for the values
	if len(c.vs) != 10 {
		t.Errorf("parseValue() did not use the cache: expected %d values, got %d", 10, len(c.vs))
	}

	// Check that the values in the cache are correct
	expectedValues := []Type{
		TypeObject,
		TypeString,
		TypeNumber,
	}
	for i, value := range c.vs {
		if i >= len(expectedValues) {
			break
		}
		if value.t != expectedValues[i] {
			t.Errorf("parseValue() cache value %d has unexpected type: %v, expected %v", i, value.t, expectedValues[i])
		}
	}
}

