		t.Errorf("parseValue() error = %v", err)
	}

	if v == nil {
		t.Errorf("parseValue() returned nil value")
	}

	if tail != "" {
		t.Errorf("parseValue() returned non-empty tail: %s", tail)
	}

	if len(c.vs) != 2 {
		t.Errorf("parseValue() did not use the cache: expected %d values, got %d", 2, len(c.vs))
	}

	if c.vs[1].t != TypeNumber {
		t.Errorf("parseValue() cache value 1 has unexpected type: %v, expected %v", c.vs[1].t, TypeNumber)
	}

	if c.vs[1].s != "NaN" {
		t.Errorf("parseValue() cache value 1 has unexpected string: %v, expected %v", c.vs[1].s, "NaN")
	}
}

func TestParseValue_Unmarshal(t *testing.T) {
	s := `{"key1": "value1", "key2": 2}`
	c := &cache{}
	v, _, err := parseValue(s, c, 0)

	if err != nil {
		t.Errorf("parseValue() error = %v", err)
	}

	var m map[string]interface{}
	if err := json.Unmarshal([]byte(v.MarshalTo(nil)), &m); err != nil {
		t.Errorf("json.Unmarshal() error = %v", err)
	}

	if m["key1"] != "value1" {
		t.Errorf("json.Unmarshal() key1 value mismatch: %v != %v", m["key1"], "value1")
	}

	if m["key2"] != float64(2) {
