			args: args{
				s: "\\u0061hello\\u0062",
			},
			want: "ahello b",
		},
		{
			name: "escaped surrogate pair",
			args: args{
				s: "\\uD83D\\uDE01hello\\uD83D\\uDE02",
			},
			want: "üòÅhelloüòÇ",
		},
		{
			name: "invalid escape sequence",
			args: args{
				s: "\\xhello\\x",
			},
			want: "\\xhello\\x",
		},
