	t.Run("unescapeStringBestEffort", func(t *testing.T) {
		t.Logf("unescapeStringBestEffort: %s", jsonString)
		start := time.Now()
		for i := 0; i < 100; i++ {
			unescapeStringBestEffort(jsonString)
		}
