func TestParseArray_Example(t *testing.T) {
	var v *Value
	var s string
	var err error
	c := &cache{}
	v, s, err = parseArray(`[1, 2, "test", true, false, null]`, c, 0)
	if err != nil {
		t.Errorf("parseArray() error = %v", err)
	}

	// Convert the Value to JSON string
	b, err := json.MarshalIndent(v, "", "  ")
	if err != nil {
		t.Errorf("json.MarshalIndent() error = %v", err)
	}
	fmt.Println(string(b))

	// Example of how to access the values
	if len(v.a) != 6 {
		t.Errorf("incorrect length of array %v", len(v.a))
	}

	// First element is a number
	if v.a[0].Type() != TypeNumber {
		t.Errorf("expected TypeNumber, got %v", v.a[0].Type())
	}

	// Second element is a number
	if v.a[1].Type() != TypeNumber {
		t.Errorf("expected TypeNumber, got %v", v.a[1].Type())
	}

	// Third element is a string
	if v.a[2].Type() != TypeString {
		t.Errorf("expected TypeString, got %v", v.a[2].Type())
	}

	// Fourth element is a boolean (true)
	if v.a[3].Type() != TypeTrue {
		t.Errorf("expected TypeTrue, got %v", v.a[3].Type())
	}

	// Fifth element is a boolean (false)
	if v.a[4].Type() != TypeFalse {
		t.Errorf("expected TypeFalse, got %v", v.a[4].Type())
	}

	// Sixth element is a null
	if v.a[5].Type() != TypeNull {
		t.Errorf("expected TypeNull, got %v", v.a[5].Type())
	}
}

