					return
				}
			}
			if gotTail != tt.want.tail {
				t.Errorf("parseValue() tail = %v, want %v", gotTail, tt.want.tail)
				return
			}
			if !valueEqual(gotV, tt.want.v) {
				t.Errorf("parseValue() = %v, want %v", gotV, tt.want.v)
				return
			}
