func valueEqual(v1, v2 *Value) bool {
	if v1 == nil && v2 == nil {
		return true
	}
	if v1 == nil || v2 == nil {
		return false
	}
	if v1.t != v2.t {
		return false
	}
	switch v1.t {
	case TypeObject:
		if len(v1.o.kvs) != len(v2.o.kvs) {
			return false
		}
		for i, kv1 := range v1.o.kvs {
			kv2 := v2.o.kvs[i]
			if kv1.k != kv2.k {
				return false
			}
			if !valueEqual(kv1.v, kv2.v) {
				return false
			}
		}
		return true
	case TypeArray:
		if len(v1.a) != len(v2.a) {
			return false
		}
		for i, a1 := range v1.a {
			a2 := v2.a[i]
			if !valueEqual(a1, a2) {
				return false
			}
		}
		return true
	case TypeString, TypeNumber, TypeTrue, TypeFalse, TypeNull:
		return v1.s == v2.s
	default:
		return false
	}
}

func TestParseValue_WithCache(t *testing.T) {
	c := &cache{
		vs: make([]Value, 10),
	}
	for i := 0; i < 10; i++ {
		c.vs[i].t = TypeNull
	}
	v1, _, _ := parseValue(`"hello"`, c, 0)
	v2, _, _ := parseValue(`"world"`, c, 0)
	if v1.s == v2.s {
		t.Errorf("parseValue() with cache: got same value for different strings, want different values")
	}
	v3, _, _ := parseValue(`"hello"`, c, 0)
	if v1.s != v3.s {
		t.Errorf("parseValue() with cache: got different value for the same string, want same values")
	}
}

