			input:  `{"name": "John \\"Doe\\"", "age": 30}`,
			expect: `{"name": "John \"Doe\"", "age": 30}`,
		},
		{
			input:  `{"message": "Hello, \\"world\\"! \\u00A0\\uD83D\\uDE01\\nThis is a \\"test\\" string."}`,
			expect: `{"message": "Hello, \"world\"! \uD83D\uDE01\nThis is a \"test\" string."}`,
		},
	}
