			// Parse the JSON input using the standard library.
			var data interface{}
			err := json.Unmarshal([]byte(tc.input), &data)
			if err != nil {
				t.Errorf("Error unmarshaling JSON: %s", err)
				return
			}

			// Parse the JSON input using fastjson and unescape the string using unescapeStringBestEffort.
			v, err := Parse(tc.input)
			if err != nil {
				t.Errorf("Error parsing JSON: %s", err)
				return
			}
			unescapedString := unescapeStringBestEffort(v.StringBytes())

			// Marshal the unescaped string back to JSON.
			marshaledString, err := json.Marshal(unescapedString)
			if err != nil {
				t.Errorf("Error marshaling JSON: %s", err)
				return
			}

			// Compare the results.
			if string(marshaledString) != tc.expect {
				t.Errorf("Expected JSON: %s, got: %s", tc.expect, string(marshaledString))
