func TestParseObject_Unmarshal(t *testing.T) {
	type MyStruct struct {
		Key1 string `json:"key1"`
		Key2 string `json:"key2"`
	}
	tests := []struct {
		name     string
		jsonStr  string
		wantData MyStruct
		wantErr  bool
	}{
