			name:    "simple object",
			jsonStr: `{"key1": "value1", "key2": "value2"}`,
			wantData: MyStruct{
				Key1: "value1",
				Key2: "value2",
			},
			wantErr: false,
		},
		{
			name:    "nested object",
			jsonStr: `{"key1": {"nestedKey": "nestedValue"}, "key2": "value2"}`,
			wantData: MyStruct{
				Key1: `{"nestedKey": "nestedValue"}`,
				Key2: "value2",
			},
			wantErr: false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			v, _, err := parseObject(tt.jsonStr, &cache{}, 0)
			if (err != nil) != tt.wantErr {
				t.Errorf("parseObject() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if tt.wantErr {
				return
			}
			var gotData MyStruct
			if err := json.Unmarshal(v.MarshalTo(nil), &gotData); err != nil {
				t.Errorf("json.Unmarshal() error = %v", err)
				return
			}
			if !reflect.DeepEqual(gotData, tt.wantData) {
				t.Errorf("parseObject() gotData = %v, want %v", gotData, tt.wantData)
			}
		})
	}
}

