func TestCacheGetValue(t *testing.T) {
	c := &cache{}

	// Test that getValue appends a new Value to the slice and returns a pointer to it
	v1 := c.getValue()
	if len(c.vs) != 1 {
		t.Errorf("Expected length of vs to be 1, got %d", len(c.vs))
	}
	if v1 == nil {
		t.Error("Expected getValue to return a non-nil pointer to Value")
	}

	// Test that getValue returns a pointer to the existing Value
	v2 := c.getValue()
	if len(c.vs) != 2 {
		t.Errorf("Expected length of vs to be 2, got %d", len(c.vs))
	}
	if v2 == nil {
		t.Error("Expected getValue to return a non-nil pointer to Value")
	}
	if v1 == v2 {
		t.Error("Expected getValue to return different pointers to Value")
	}
}

