				v:   &Value{t: typeRawString, s: "hello"},
			},
			want: []byte("\"hello\""),
		},
		{
			name: "Marshal Number",
			args: args{
				dst: []byte{},
				v:   &Value{t: TypeNumber, s: "123"},
			},
			want: []byte("123"),
		},
		{
			name: "Marshal Array",
			args: args{
				dst: []byte{},
				v:   &Value{t: TypeArray, a: []*Value{{t: TypeNumber, s: "1"}, {t: TypeString, s: "hello"}}},
			},
			want: []byte("[1,\"hello\"]"),
		},
		{
			name: "Marshal Object",
			args: args{
				dst: []byte{},
				v:   &Value{t: TypeObject, o: Object{kvs: []kv{{k: "key", v: &Value{t: TypeString, s: "value"}}}}},
			},
			want: []byte(`{"key":"value"}`),
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := tt.args.v.MarshalTo(tt.args.dst); !bytesEqual(got, tt.want) {
				t.Errorf("Value.MarshalTo() = %v, want %v", got, tt.want)
			}
		})
	}
}

func bytesEqual(a, b []byte) bool {
	if len(a) != len(b) {
		return false
	}
	for i := range a {
		if a[i] != b[i] {
			return false
		}
	}
	return true
}

