			args: args{s: "\\\"hello world\\\""},
			want: "\"hello world\"",
		},
		{
			name: "escaped backslashes",
			args: args{s: "\\\\hello world\\\\"},
			want: "\\hello world\\",
		},
		{
			name: "escaped forward slashes",
			args: args{s: "\\/hello world\\/"},
			want: "/hello world/",
		},
		{
			name: "escaped backspace",
			args: args{s: "\\bhello world\\b"},
			want: "\bhello world\b",
		},
		{
			name: "escaped form feed",
			args: args{s: "\\fhello world\\f"},
			want: "\fhello world\f",
		},
		{
			name: "escaped newline",
			args: args{s: "\\nhello world\\n"},
			want: "\nhello world\n",
		},
		{
			name: "escaped carriage return",
			args: args{s: "\\rhello world\\r"},
			want: "\rhello world\r",
		},
		{
			name: "escaped tab",
			args: args{s: "\\thello world\\t"},
			want: "\thello world\t",
		},
		{
			name: "escaped unicode character",
			args: args{s: "\\u0061hello world\\u0062"},
			want: "ahello worldb",
		},
		{
			name: "escaped surrogate pair",
			args: args{s: "\\uD83D\\uDE01hello world"},
			want: "üòÅhello world",
		},
		{
			name: "invalid escape sequence",
			args: args{s: "\\xhello world"},
			want: "\\xhello world",
		},
		{
			name: "incomplete escape sequence",
			args: args{s: "\\uhello world"},
			want: "\\uhello world",
		},
		{
			name: "multiple escape sequences",
			args: args{s: "\\\"hello\\tworld\\u0061\\\\\""},
			want: "\"hello\tworlda\\\"",
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := unescapeStringBestEffort(tt.args.s); got != tt.want {
				t.Errorf("unescapeStringBestEffort() = %v, want %v", got, tt.want)
			}
		})
	}
}

func Test_unescapeStringBestEffort_surrogate(t *testing.T) {
	// Surrogate pairs are handled correctly
	s := `\uD83D\uDE01`
	want := "üòÅ"
	if got := unescapeStringBestEffort(s); got != want {
		t.Errorf("unescapeStringBestEffort() = %v, want %v", got, want)
	}

	// Incomplete surrogate pairs are handled correctly
	s = `\uD83Dhello world`
	want = `\uD83Dhello world`
	if got := unescapeStringBestEffort(s); got != want {
		t.Errorf("unescapeStringBestEffort() = %v, want %v", got, want)
	}

	// Invalid surrogate pairs are handled correctly
	s = `\uD83D\u0000hello world`
	want = `\uD83D\u0000hello world`
	if got := unescapeStringBestEffort(s); got != want {
		t.Errorf("unescapeStringBestEffort() = %v, want %v", got, want)
	}

	// Surrogate pairs with invalid escape sequences are handled correctly
	s = `\uD83D\x0000hello world`
	want = `\uD83D\x0000hello world`
	if got := unescapeStringBestEffort(s); got != want {
		t.Errorf("unescapeStringBestEffort() = %v, want %v", got, want)
	}
}

func Test_unescapeStringBestEffort_hex(t *testing.T) {
	// Hexadecimal escape sequences are handled correctly
	s := `\u0061`
	want := "a"
	if got := unescapeStringBestEffort(s); got != want {
		t.Errorf("unescapeStringBestEffort() = %v, want %v", got, want)
	}

	// Incomplete hexadecimal escape sequences are handled correctly
	s = `\u006hello world`
	want = `\u006hello world`
	if got := unescapeStringBestEffort(s); got != want {
		t.Errorf("unescapeStringBestEffort() = %v, want %v", got, want)
	}

	// Invalid hexadecimal escape sequences are handled correctly
	s = `\u00gghello world`
	want = `\u00gghello world`
	if got := unescapeStringBestEffort(s); got != want {
		t.Errorf("unescapeStringBestEffort() = %v, want %v", got, want)
	}

	// Hexadecimal escape sequences with invalid characters are handled correctly
	s = `\u0061\x00hello world`
	want = `\u0061\x00hello world`
	if got := unescapeStringBestEffort(s); got != want {
		t.Errorf("unescapeStringBestEffort() = %v, want %v", got, want)
	}
}

func Test_unescapeStringBestEffort_strconv(t *testing.T) {
	// Test strconv.ParseUint for invalid hexadecimal escape sequences
	s := `\u00gg`
	_, err := strconv.ParseUint(s[2:6], 16, 16)
	if err == nil {
		t.Errorf("strconv.ParseUint() should have returned an error for invalid hexadecimal escape sequence")
	}

	// Test strconv.ParseUint for valid hexadecimal escape sequences
	s = `\u0061`
	x, err := strconv.ParseUint(s[2:6], 16, 16)
	if err != nil {
		t.Errorf("strconv.ParseUint() returned an error for valid hexadecimal escape sequence: %v", err)
	}
	if x != 0x61 {
		t.Errorf("strconv.ParseUint() returned incorrect value: %v", x)
	}
}

func Test_unescapeStringBestEffort_utf16(t *testing.T) {
	// Test utf16.IsSurrogate for valid surrogate characters
	r := rune(0xD83D)
	if !utf16.IsSurrogate(r) {
		t.Errorf("utf16.IsSurrogate() should have returned true for valid surrogate character")
	}

	// Test utf16.IsSurrogate for invalid surrogate characters
	r = rune(0x0061)
	if utf16.IsSurrogate(r) {
		t.Errorf("utf16.IsSurrogate() should have returned false for invalid surrogate character")
	}

	// Test utf16.DecodeRune for valid surrogate pairs
	r1 := rune(0xD83D)
	r2 := rune(0xDE01)
	r := utf16.DecodeRune(r1, r2)
	if r != 0x1F601 {
		t.Errorf("utf16.DecodeRune() returned incorrect value: %v", r)
	}

	// Test utf16.DecodeRune for invalid surrogate pairs
	r1 = rune(0xD83D)
	r2 = rune(0x0000)
	r = utf16.DecodeRune(r1, r2)
	if r != utf16.ReplacementChar {
		t.Errorf("utf16.DecodeRune() returned incorrect value: %v", r)
	}
}

