package fastjson

import (
	"testing"
)

func TestCacheGetValue(t *testing.T) {
	t.Run("empty cache", func(t *testing.T) {
		c := &cache{}
		v := c.getValue()
		if v == nil {
			t.Errorf("getValue() returned nil for an empty cache")
		}
	})

	t.Run("non-empty cache", func(t *testing.T) {
		c := &cache{
			vs: []Value{
				{t: TypeString, s: "test"},
			},
		}
		v := c.getValue()
		if v == nil {
			t.Errorf("getValue() returned nil for a non-empty cache")
		}
		if v.t != TypeString {
			t.Errorf("getValue() returned incorrect type: got %v, want %v", v.t, TypeString)
		}
		if v.s != "test" {
			t.Errorf("getValue() returned incorrect value: got %v, want %v", v.s, "test")
		}
	})

	t.Run("capacity greater than length", func(t *testing.T) {
		c := &cache{
			vs: make([]Value, 1),
		}
		v := c.getValue()
		if v == nil {
			t.Errorf("getValue() returned nil for a cache with capacity greater than length")
		}
		if len(c.vs) != 2 {
			t.Errorf("getValue() did not resize the cache: got length %v, want %v", len(c.vs), 2)
		}
	})

	t.Run("capacity equal to length", func(t *testing.T) {
		c := &cache{
			vs: make([]Value, 1),
		}
		c.vs = c.vs[:cap(c.vs)]
		v := c.getValue()
		if v == nil {
			t.Errorf("getValue() returned nil for a cache with capacity equal to length")
		}
		if len(c.vs) != 2 {
			t.Errorf("getValue() did not resize the cache: got length %v, want %v", len(c.vs), 2)
		}
	})
}

