func TestParseRawKey(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name    string
		args    args
		wantKey string
		wantTail string
		wantErr  bool
	}{
		{
			name:    "simple key",
			args:    args{s: `"key"`},
			wantKey: "key",
			wantTail: "",
			wantErr:  false,
		},
		{
			name:    "key with space",
			args:    args{s: `"key with space"`},
			wantKey: "key with space",
			wantTail: "",
			wantErr:  false,
		},
		{
			name:    "key with escape sequences",
			args:    args{s: `"key\\"with\\"escape\\"sequences"`},
			wantKey: "key\\\"with\\\"escape\\\"sequences",
			wantTail: "",
			wantErr:  false,
		},
		{
			name:    "missing closing quote",
			args:    args{s: `"key`},
			wantKey: "",
			wantTail: "",
			wantErr:  true,
		},
		{
			name:    "empty key",
			args:    args{s: `""`},
			wantKey: "",
			wantTail: "",
			wantErr:  false,
		},
		{
			name:    "key with backslash",
			args:    args{s: `"key\\"`},
			wantKey: "key\\",
			wantTail: "",
			wantErr:  false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			gotKey, gotTail, err := parseRawKey(tt.args.s)
			if (err != nil) != tt.wantErr {
				t.Errorf("parseRawKey() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if gotKey != tt.wantKey {
				t.Errorf("parseRawKey() gotKey = %v, want %v", gotKey, tt.wantKey)
			}
			if gotTail != tt.wantTail {
				t.Errorf("parseRawKey() gotTail = %v, want %v", gotTail, tt.wantTail)
			}
		})
	}
}

