package fastjson

import (
	"testing"
)

func TestSkipWS(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want string
	}{
		{
			name: "empty string",
			args: args{s: ""},
			want: "",
		},
		{
			name: "no whitespace",
			args: args{s: "abc"},
			want: "abc",
		},
		{
