func TestParseValue_JSON(t *testing.T) {
	c := &cache{}
	jsonStr := `{
		"key1": "value1",
		"key2": [1, 2, 3],
		"key3": {
			"key4": true,
			"key5": null
		}
	}`
	var expected map[string]interface{}
	if err := json.Unmarshal([]byte(jsonStr), &expected); err != nil {
		t.Fatal(err)
	}
	v, _, err := parseValue(jsonStr, c, 0)
	if err != nil {
		t.Fatal(err)
	}
	if v.t != TypeObject {
		t.Errorf("Expected object, got %v", v.t)
	}
	for key, value := range expected {
		if !v.Exists(key) {
			t.Errorf("Key %s not found", key)
			continue
		}
		switch value.(type) {
		case string:
			if v.GetString(key) != value {
				t.Errorf("Expected %v for key %s, got %v", value, key, v.GetString(key))
			}
		case []interface{}:
			arr, err := v.GetArray(key)
			if err != nil {
				t.Errorf("Error getting array for key %s: %v", key, err)
				continue
			}
			if len(arr) != len(value.([]interface{})) {
				t.Errorf("Expected array length %d for key %s, got %d", len(value.([]interface{})), key, len(arr))
				continue
			}
			for i, val := range value.([]interface{}) {
				switch val.(type) {
				case float64:
					if arr[i].GetFloat64() != val {
						t.Errorf("Expected %v for key %s[%d], got %v", val, key, i, arr[i].GetFloat64())
					}
				default:
					t.Errorf("Unsupported type %T for key %s[%d]", val, key, i)
				}
			}
		case map[string]interface{}:
			obj, err := v.GetObject(key)
			if err != nil {
				t.Errorf("Error getting object for key %s: %v", key, err)
				continue
			}
			for k, val := range value.(map[string]interface{}) {
				switch val.(type) {
				case bool:
					if obj.GetBool(k) != val {
						t.Errorf("Expected %v for key %s[%s], got %v", val, key, k, obj.GetBool(k))
					}
				case nil:
					if !obj.Exists(k) {
						t.Errorf("Expected key %s[%s] to exist", key, k)
					}
				default:
					t.Errorf("Unsupported type %T for key %s[%s]", val, key, k)
				}
			}
		default:
			t.Errorf("Unsupported type %T for key %s", value, key)
		}
	}
}

