package fastjson

import (
	"encoding/json"
	"fmt"
	"testing"
)

func TestParseValue(t *testing.T) {
	type args struct {
		s   string
		c   *cache
		depth int
	}
	type want struct {
		v   *Value
		tail string
		err  error
	}
	tests := []struct {
		name string
		args args
		want want
	}{
		{
			name: "empty string",
			args: args{
				s:   "",
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v:   nil,
				tail: "",
				err:  fmt.Errorf("cannot parse empty string"),
			},
		},
		{
			name: "too big depth",
			args: args{
				s:   "{}",
				c:   &cache{},
				depth: MaxDepth + 1,
			},
			want: want{
				v:   nil,
				tail: "{}",
				err:  fmt.Errorf("too big depth for the nested JSON; it exceeds %d", MaxDepth),
			},
		},
		{
			name: "object",
			args: args{
				s:   "{ \"a\": 1 }",
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					o: Object{
						kvs: []kv{
							{
								k: "a",
								v: &Value{
									t: TypeNumber,
									s: "1",
								},
							},
						},
					},
					t: TypeObject,
				},
				tail: "",
				err:  nil,
			},
		},
		{
			name: "array",
			args: args{
				s:   "[ 1, 2, 3 ]",
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					a: []*Value{
						{
							t: TypeNumber,
							s: "1",
						},
						{
							t: TypeNumber,
							s: "2",
						},
						{
							t: TypeNumber,
							s: "3",
						},
					},
					t: TypeArray,
				},
				tail: "",
				err:  nil,
			},
		},
		{
			name: "string",
			args: args{
				s:   "\"hello\"",
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: typeRawString,
					s: "hello",
				},
				tail: "",
				err:  nil,
			},
		},
		{
			name: "true",
			args: args{
				s:   "true",
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v:   valueTrue,
				tail: "",
				err:  nil,
			},
		},
		{
			name: "false",
			args: args{
				s:   "false",
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v:   valueFalse,
				tail: "",
				err:  nil,
			},
		},
		{
			name: "null",
			args: args{
				s:   "null",
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v:   valueNull,
				tail: "",
				err:  nil,
			},
		},
		{
			name: "number",
			args: args{
				s:   "123",
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeNumber,
					s: "123",
				},
				tail: "",
				err:  nil,
			},
		},
		{
			name: "NaN",
			args: args{
				s:   "NaN",
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeNumber,
					s: "NaN",
				},
				tail: "",
				err:  nil,
			},
		},
		{
			name: "unexpected value",
			args: args{
				s:   "tru",
				c:   &cache{},
				depth: 0,
			},
			want: want{
				v:   nil,
				tail: "tru",
				err:  fmt.Errorf("unexpected value found: %q", "tru"),
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			gotV, gotTail, gotErr := parseValue(tt.args.s, tt.args.c, tt.args.depth)
			if gotErr != nil {
				if tt.want.err == nil {
					t.Errorf("parseValue() error = %v, want nil", gotErr)
					return
				}
				if gotErr.Error() != tt.want.err.Error() {
					t.Errorf("parseValue() error = %v, want %v", gotErr, tt.want.err)
					return
				}
			} else if tt.want.err != nil {
				t.Errorf("parseValue() error = %v, want %v", gotErr, tt.want.err)
				return
			}

			if !reflect.DeepEqual(gotV, tt.want.v) {
				t.Errorf("parseValue() gotV = %v, want %v", gotV, tt.want.v)
			}

			if gotTail != tt.want.tail {
				t.Errorf("parseValue() gotTail = %v, want %v", gotTail, tt.want.tail)
			}
		})
	}
}

