				depth: 0,
			},
			want: &Value{
				t: TypeArray,
				a: []*Value{
					{
						t: TypeArray,
						a: []*Value{
							{
								t:  TypeString,
								s: "hello",
							},
							{
								t:  TypeString,
								s: "world",
							},
						},
					},
					{
