func compareValue(v1, v2 *Value) bool {
	if v1 == nil && v2 == nil {
		return true
	}
	if v1 == nil || v2 == nil {
		return false
	}
	if v1.t != v2.t {
		return false
	}
	switch v1.t {
	case TypeArray:
		if len(v1.a) != len(v2.a) {
			return false
		}
		for i := range v1.a {
			if !compareValue(v1.a[i], v2.a[i]) {
				return false
			}
		}
	case TypeObject:
		if len(v1.o.kvs) != len(v2.o.kvs) {
			return false
		}
		for i := range v1.o.kvs {
			if v1.o.kvs[i].k != v2.o.kvs[i].k {
				return false
			}
			if !compareValue(v1.o.kvs[i].v, v2.o.kvs[i].v) {
				return false
			}
		}
	case TypeString:
		if v1.s != v2.s {
			return false
		}
	case TypeNumber:
		if v1.s != v2.s {
			return false
		}
	case TypeTrue:
		return true
	case TypeFalse:
		return true
	case TypeNull:
		return true
	case typeRawString:
		if v1.s != v2.s {
			return false
		}
	}
	return true
}

