			want: []interface{}{1, 2, 3},
		},
		{
			json: `["hello", "world"]`,
			want: []interface{}{"hello", "world"},
		},
		{
			json: `[{"key1": "value1"}, {"key2": "value2"}]`,
			want: []interface{}{
				map[string]interface{}{"key1": "value1"},
				map[string]interface{}{"key2": "value2"},
