		args args
		want string
	}{
		{
			name: "empty string",
			args: args{
				s: "",
			},
			want: "",
		},
		{
			name: "no escape sequences",
			args: args{
				s: "hello world",
			},
			want: "hello world",
		},
		{
			name: "escaped quotes",
			args: args{
				s: "\"hello world\"",
			},
			want: "\"hello world\"",
		},
		{
			name: "escaped backslashes",
			args: args{
				s: "\\hello world",
			},
			want: "\\hello world",
		},
		{
			name: "escaped slashes",
			args: args{
				s: "/hello world",
			},
			want: "/hello world",
		},
		{
			name: "escaped backspace",
			args: args{
				s: "\\bhello world",
			},
			want: "\bhello world",
		},
		{
			name: "escaped form feed",
			args: args{
				s: "\\fhello world",
			},
			want: "\fhello world",
		},
		{
			name: "escaped newline",
			args: args{
				s: "\\nhello world",
			},
			want: "\nhello world",
		},
		{
			name: "escaped carriage return",
			args: args{
				s: "\\rhello world",
			},
			want: "\rhello world",
		},
		{
			name: "escaped tab",
			args: args{
				s: "\\thello world",
			},
			want: "\thello world",
		},
		{
			name: "escaped unicode",
			args: args{
				s: "\\u0020hello world",
			},
			want: " hello world",
		},
		{
			name: "escaped unicode surrogate pair",
			args: args{
				s: "\\uD83D\\uDE00hello world",
			},
			want: "üòÅhello world",
		},
		{
			name: "invalid escape sequence",
			args: args{
				s: "\\xhello world",
			},
			want: "\\xhello world",
		},
		{
			name: "incomplete unicode escape sequence",
			args: args{
				s: "\\u002hello world",
