		{"true", "true"},
		{"false", "false"},
		{"123", "123"},
		{"123.456", "123.456"},
		{"\"string\"", "\"string\""},
		{"[1,2,3]", "[1,2,3]"},
		{"{\"key1\":\"value1\",\"key2\":\"value2\"}", "{\"key1\":\"value1\",\"key2\":\"value2\"}"},
		{"{\"key1\":[1,2,3],\"key2\":{\"key3\":\"value3\"}}", "{\"key1\":[1,2,3],\"key2\":{\"key3\":\"value3\"}}"},
