func TestUnescapeStringBestEffort(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want string
	}{
		{
			name: "empty string",
			args: args{s: ""},
			want: "",
		},
		{
			name: "no escape sequences",
			args: args{s: "hello world"},
			want: "hello world",
		},
		{
			name: "escaped quotes",
			args: args{s: `\"hello world\"`},
			want: `"hello world"`,
		},
		{
			name: "escaped backslashes",
			args: args{s: `\\hello world`},
			want: `\hello world`,
		},
		{
			name: "escaped forward slashes",
			args: args{s: `\/hello world`},
			want: `/hello world`,
		},
		{
			name: "escaped backspace",
			args: args{s: `\bhello world`},
			want: "\bhello world",
		},
		{
			name: "escaped form feed",
			args: args{s: `\fhello world`},
			want: "\fhello world",
		},
		{
			name: "escaped newline",
			args: args{s: `\nhello world`},
			want: "\nhello world",
		},
		{
			name: "escaped carriage return",
			args: args{s: `\rhello world`},
			want: "\rhello world",
		},
		{
			name: "escaped tab",
			args: args{s: `\thello world`},
			want: "\thello world",
		},
		{
			name: "escaped unicode",
			args: args{s: `\u0061hello world`},
			want: "ahello world",
		},
		{
			name: "escaped surrogate pair",
			args: args{s: `\uD83D\uDE01hello world`},
			want: "üòÅhello world",
		},
		{
			name: "invalid escape sequence",
			args: args{s: `\xhello world`},
			want: `\xhello world`,
		},
		{
			name: "short escape sequence",
			args: args{s: `\uhello world`},
			want: `\uhello world`,
		},
		{
			name: "multiple escape sequences",
			args: args{s: `\b\f\n\r\thello world`},
			want: "\b\f\n\r\thello world",
		},
		{
			name: "escaped unicode with invalid hex",
			args: args{s: `\u006zhello world`},
			want: `\u006zhello world`,
		},
		{
			name: "escaped surrogate pair with invalid hex",
			args: args{s: `\uD83D\uDE0zhello world`},
			want: `\uD83D\uDE0zhello world`,
		},
		{
			name: "escaped surrogate pair with short sequence",
			args: args{s: `\uD83Dhello world`},
			want: `\uD83Dhello world`,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := unescapeStringBestEffort(tt.args.s); got != tt.want {
				t.Errorf("unescapeStringBestEffort() = %v, want %v", got, tt.want)
			}
		})
	}
}

