				s:    "{}",
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeObject,
					o: Object{
						kvs:           nil,
						keysUnescaped: false,
					},
				},
				s:    "",
				err:  nil,
				want: "{}",
			},
		},
		{
			name: "object with one key-value pair",
			args: args{
				s:    `{"key1": "value1"}`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeObject,
					o: Object{
						kvs: []kv{
							{
								k: "key1",
								v: &Value{
									t: TypeString,
									s: "value1",
								},
							},
						},
						keysUnescaped: false,
					},
				},
				s:    "",
				err:  nil,
				want: `{"key1":"value1"}`,
			},
		},
		{
			name: "object with multiple key-value pairs",
			args: args{
				s:    `{"key1": "value1", "key2": "value2", "key3": "value3"}`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeObject,
					o: Object{
						kvs: []kv{
							{
								k: "key1",
								v: &Value{
									t: TypeString,
									s: "value1",
								},
							},
							{
								k: "key2",
								v: &Value{
									t: TypeString,
									s: "value2",
								},
							},
							{
								k: "key3",
								v: &Value{
									t: TypeString,
									s: "value3",
								},
							},
						},
						keysUnescaped: false,
					},
				},
				s:    "",
				err:  nil,
				want: `{"key1":"value1","key2":"value2","key3":"value3"}`,
			},
		},
		{
			name: "object with nested objects",
			args: args{
				s:    `{"key1": {"nestedKey1": "nestedValue1"}, "key2": "value2"}`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeObject,
					o: Object{
						kvs: []kv{
							{
								k: "key1",
								v: &Value{
									t: TypeObject,
									o: Object{
										kvs: []kv{
											{
												k: "nestedKey1",
												v: &Value{
													t: TypeString,
													s: "nestedValue1",
												},
											},
										},
										keysUnescaped: false,
									},
								},
							},
							{
								k: "key2",
								v: &Value{
									t: TypeString,
									s: "value2",
								},
							},
						},
						keysUnescaped: false,
					},
				},
				s:    "",
				err:  nil,
				want: `{"key1":{"nestedKey1":"nestedValue1"},"key2":"value2"}`,
			},
		},
		{
			name: "object with escaped keys",
			args: args{
				s:    `{"key\\\"1": "value1", "key\\\"2": "value2"}`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v: &Value{
					t: TypeObject,
					o: Object{
						kvs: []kv{
							{
								k: "key\"1",
								v: &Value{
									t: TypeString,
									s: "value1",
								},
							},
							{
								k: "key\"2",
								v: &Value{
									t: TypeString,
									s: "value2",
								},
							},
						},
						keysUnescaped: false,
					},
				},
				s:    "",
				err:  nil,
				want: `{"key\"1":"value1","key\"2":"value2"}`,
			},
		},
		{
			name: "object with missing closing brace",
			args: args{
				s:    `{"key1": "value1`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v:    nil,
				s:    `{"key1": "value1`,
				err:  fmt.Errorf("missing '}'"),
				want: "",
			},
		},
		{
			name: "object with missing colon after key",
			args: args{
				s:    `{"key1" "value1"}`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v:    nil,
				s:    `{"key1" "value1"}`,
				err:  fmt.Errorf("missing ':' after object key"),
				want: "",
			},
		},
		{
			name: "object with missing comma after value",
			args: args{
				s:    `{"key1": "value1" "key2": "value2"}`,
				c:    &cache{},
				depth: 0,
			},
			want: want{
				v:    nil,
				s:    `{"key1": "value1" "key2": "value2"}`,
				err:  fmt.Errorf("missing ',' after object value"),
				want: "",
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			gotV, gotS, gotErr := parseObject(tt.args.s, tt.args.c, tt.args.depth)
			if (gotErr == nil && tt.want.err != nil) || (gotErr != nil && tt.want.err == nil) || (gotErr != nil && tt.want.err != nil && gotErr.Error() != tt.want.err.Error()) {
				t.Errorf("parseObject() error = %v, wantErr %v", gotErr, tt.want.err)
				return
			}
			if gotS != tt.want.s {
				t.Errorf("parseObject() gotS = %v, want %v", gotS, tt.want.s)
			}
			if gotV == nil && tt.want.v != nil {
				t.Errorf("parseObject() gotV = %v, want %v", gotV, tt.want.v)
				return
			}
			if gotV != nil && tt.want.v == nil {
				t.Errorf("parseObject() gotV = %v, want %v", gotV, tt.want.v)
				return
			}
			if gotV != nil && tt.want.v != nil {
				if gotV.t != tt.want.v.t {
					t.Errorf("parseObject() gotV.t = %v, want %v", gotV.t, tt.want.v.t)
				}
				if len(gotV.o.kvs) != len(tt.want.v.o.kvs) {
					t.Errorf("parseObject() gotV.o.kvs length = %v, want %v", len(gotV.o.kvs), len(tt.want.v.o.kvs))
				}
				for i, kv := range gotV.o.kvs {
					if kv.k != tt.want.v.o.kvs[i].k {
						t.Errorf("parseObject() gotV.o.kvs[%d].k = %v, want %v", i, kv.k, tt.want.v.o.kvs[i].k)
					}
					if kv.v.t != tt.want.v.o.kvs[i].v.t {
						t.Errorf("parseObject() gotV.o.kvs[%d].v.t = %v, want %v", i, kv.v.t, tt.want.v.o.kvs[i].v.t)
					}
					if kv.v.s != tt.want.v.o.kvs[i].v.s {
						t.Errorf("parseObject() gotV.o.kvs[%d].v.s = %v, want %v", i, kv.v.s, tt.want.v.o.kvs[i].v.s)
					}
				}
			}
		})
	}
}

