import (
	"strconv"
	"testing"
	"unicode/utf16"
)

func TestUnescapeStringBestEffort(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want string
	}{
		{
			name: "empty string",
			args: args{
				s: "",
			},
			want: "",
		},
		{
			name: "no escape sequences",
			args: args{
				s: "hello world",
			},
			want: "hello world",
		},
		{
			name: "escaped quotes",
			args: args{
				s: "\\\"hello\\\"",
			},
			want: "\"hello\"",
		},
		{
			name: "escaped backslashes",
			args: args{
				s: "\\\\hello\\\\",
			},
			want: "\\hello\\",
		},
		{
			name: "escaped slashes",
			args: args{
				s: "\\/hello\\/",
			},
			want: "/hello/",
		},
		{
			name: "escaped b",
			args: args{
				s: "\\bhello\\b",
			},
			want: "\bhello\b",
		},
		{
			name: "escaped f",
			args: args{
				s: "\\fhello\\f",
			},
			want: "\fhello\f",
		},
		{
			name: "escaped n",
			args: args{
				s: "\\nhello\\n",
			},
			want: "\nhello\n",
		},
		{
			name: "escaped r",
			args: args{
				s: "\\rhello\\r",
			},
			want: "\rhello\r",
		},
		{
			name: "escaped t",
			args: args{
				s: "\\thello\\t",
			},
			want: "\thello\t",
		},
		{
			name: "escaped u",
			args: args{
				s: "\\u0061hello\\u0062",
			},
			want: "ahello b",
		},
		{
			name: "escaped surrogate pair",
			args: args{
				s: "\\uD83D\\uDE01hello\\uD83D\\uDE02",
			},
			want: "üòÄhelloüòÇ",
		},
		{
			name: "invalid escape sequence",
			args: args{
				s: "\\xhello\\x",
			},
			want: "\\xhello\\x",
		},
		{
			name: "incomplete escape sequence",
			args: args{
				s: "\\u0061hello",
			},
			want: "\\u0061hello",
		},
		{
			name: "incomplete surrogate pair",
			args: args{
				s: "\\uD83Dhello",
			},
			want: "\\uD83Dhello",
		},
		{
			name: "multiple escape sequences",
			args: args{
				s: "\\\"hello\\\"\\b\\f\\n\\r\\t\\u0061\\u0062",
			},
			want: "\"hello\"\b\f\n\r\ta b",
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := unescapeStringBestEffort(tt.args.s); got != tt.want {
				t.Errorf("unescapeStringBestEffort() = %v, want %v", got, tt.want)
			}
		})
	}
}

