package fastjson

import (
	"fmt"
	"testing"
)

func TestParseArray(t *testing.T) {
	type args struct {
		s    string
		c    *cache
		depth int
	}
	tests := []struct {
		name    string
		args    args
		wantV  *Value
		wantS  string
		wantErr bool
	}{
		{
			name: "empty array",
			args: args{
				s:    "[]",
				c:    &cache{},
				depth: 0,
			},
			wantV: &Value{
				t: TypeArray,
				a: []*Value{},
			},
			wantS:  "",
			wantErr: false,
		},
		{
			name: "array with one element",
			args: args{
				s:    "[1]",
				c:    &cache{},
				depth: 0,
			},
			wantV: &Value{
				t: TypeArray,
				a: []*Value{
					{
						t: TypeNumber,
						s: "1",
					},
				},
			},
			wantS:  "",
			wantErr: false,
		},
		{
			name: "array with multiple elements",
			args: args{
				s:    "[1,2,3]",
				c:    &cache{},
				depth: 0,
			},
			wantV: &Value{
				t: TypeArray,
				a: []*Value{
					{
						t: TypeNumber,
						s: "1",
					},
					{
						t: TypeNumber,
						s: "2",
					},
					{
						t: TypeNumber,
						s: "3",
					},
				},
			},
			wantS:  "",
			wantErr: false,
		},
		{
			name: "array with nested array",
			args: args{
				s:    "[[1,2],[3,4]]",
				c:    &cache{},
				depth: 0,
			},
			wantV: &Value{
				t: TypeArray,
				a: []*Value{
					{
						t: TypeArray,
						a: []*Value{
							{
								t: TypeNumber,
								s: "1",
							},
							{
								t: TypeNumber,
								s: "2",
							},
						},
					},
					{
						t: TypeArray,
						a: []*Value{
							{
								t: TypeNumber,
								s: "3",
							},
							{
								t: TypeNumber,
								s: "4",
							},
						},
					},
				},
			},
			wantS:  "",
			wantErr: false,
		},
		{
			name: "array with invalid element",
			args: args{
				s:    "[1,2,]",
				c:    &cache{},
				depth: 0,
			},
			wantV:  nil,
			wantS:  ",]",
			wantErr: true,
		},
		{
			name: "array with missing closing bracket",
			args: args{
				s:    "[1,2",
				c:    &cache{},
				depth: 0,
			},
			wantV:  nil,
			wantS:  "",
			wantErr: true,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			gotV, gotS, err := parseArray(tt.args.s, tt.args.c, tt.args.depth)
			if (err != nil) != tt.wantErr {
				t.Errorf("parseArray() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if !reflect.DeepEqual(gotV, tt.wantV) {
				t.Errorf("parseArray() gotV = %v, wantV %v", gotV, tt.wantV)
			}
			if gotS != tt.wantS {
				t.Errorf("parseArray() gotS = %v, wantS %v", gotS, tt.wantS)
			}
		})
	}
}

