package fastjson

import (
	"bytes"
	"encoding/json"
	"fmt"
	"testing"
)

func TestValueMarshalTo(t *testing.T) {
	type args struct {
		v   *Value
		dst []byte
	}
	tests := []struct {
		name string
		args args
		want []byte
	}{
		{
			name: "string",
			args: args{
				v:   &Value{t: TypeString, s: "test"},
				dst: []byte{},
			},
			want: []byte("\"test\""),
		},
		{
			name: "number",
			args: args{
				v:   &Value{t: TypeNumber, s: "123"},
				dst: []byte{},
			},
			want: []byte("123"),
		},
		{
			name: "true",
			args: args{
				v:   &Value{t: TypeTrue},
				dst: []byte{},
			},
			want: []byte("true"),
		},
		{
			name: "false",
			args: args{
				v:   &Value{t: TypeFalse},
				dst: []byte{},
			},
			want: []byte("false"),
		},
		{
			name: "null",
			args: args{
				v:   &Value{t: TypeNull},
				dst: []byte{},
			},
			want: []byte("null"),
		},
		{
			name: "object",
			args: args{
				v: &Value{
					t: TypeObject,
					o: Object{
						kvs: []kv{
							{k: "key1", v: &Value{t: TypeString, s: "value1"}},
							{k: "key2", v: &Value{t: TypeNumber, s: "123"}},
						},
					},
				},
				dst: []byte{},
			},
			want: []byte(`{"key1":"value1","key2":123}`),
		},
		{
			name: "array",
			args: args{
				v: &Value{
					t: TypeArray,
					a: []*Value{
						{t: TypeString, s: "value1"},
						{t: TypeNumber, s: "123"},
					},
				},
				dst: []byte{},
			},
			want: []byte(`["value1",123]`),
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := tt.args.v.MarshalTo(tt.args.dst); !bytes.Equal(got, tt.want) {
				t.Errorf("Value.MarshalTo() = %v, want %v", got, tt.want)
			}
		})
	}
}

func TestValueMarshalTo_escapedString(t *testing.T) {
	type args struct {
		v   *Value
		dst []byte
	}
	tests := []struct {
		name string
		args args
		want []byte
	}{
		{
			name: "escaped string",
			args: args{
				v:   &Value{t: TypeString, s: `"\t\r\n\\"`},
				dst: []byte{},
			},
			want: []byte(`"\\\"\\t\\r\\n\\\\"`),
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := tt.args.v.MarshalTo(tt.args.dst); !bytes.Equal(got, tt.want) {
				t.Errorf("Value.MarshalTo() = %v, want %v", got, tt.want)
			}
		})
	}
}

func TestValueMarshalTo_compareWithJSONMarshal(t *testing.T) {
	type args struct {
		v   *Value
		dst []byte
	}
	tests := []struct {
		name string
		args args
	}{
		{
			name: "string",
			args: args{
				v:   &Value{t: TypeString, s: "test"},
				dst: []byte{},
			},
		},
		{
			name: "number",
			args: args{
				v:   &Value{t: TypeNumber, s: "123"},
				dst: []byte{},
			},
		},
		{
			name: "true",
			args: args{
				v:   &Value{t: TypeTrue},
				dst: []byte{},
			},
		},
		{
			name: "false",
			args: args{
				v:   &Value{t: TypeFalse},
				dst: []byte{},
			},
		},
		{
			name: "null",
			args: args{
				v:   &Value{t: TypeNull},
				dst: []byte{},
			},
		},
		{
			name: "object",
			args: args{
				v: &Value{
					t: TypeObject,
					o: Object{
						kvs: []kv{
							{k: "key1", v: &Value{t: TypeString, s: "value1"}},
							{k: "key2", v: &Value{t: TypeNumber, s: "123"}},
						},
					},
				},
				dst: []byte{},
			},
		},
		{
			name: "array",
			args: args{
				v: &Value{
					t: TypeArray,
					a: []*Value{
						{t: TypeString, s: "value1"},
						{t: TypeNumber, s: "123"},
					},
				},
				dst: []byte{},
			},
		},
		{
			name: "escaped string",
			args: args{
				v:   &Value{t: TypeString, s: `"\t\r\n\\"`},
				dst: []byte{},
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			dst1 := tt.args.v.MarshalTo(tt.args.dst)
			dst2 := make([]byte, 0)
			json.Marshal(tt.args.v, &dst2)
			if !bytes.Equal(dst1, dst2) {
				t.Errorf("Value.MarshalTo() = %s, want %s", string(dst1), string(dst2))
			}
		})
	}
}

func TestValueMarshalTo_panic(t *testing.T) {
	defer func() {
		if r := recover(); r == nil {
			t.Errorf("Value.MarshalTo() should panic")
		}
	}()
	v := &Value{t: 8}
	v.MarshalTo([]byte{})
}

