				}
			}
		})
	}
}

func compareValue(got, want *Value) bool {
	if got == nil && want == nil {
		return true
	}
	if got == nil || want == nil {
		return false
	}
	if got.t != want.t {
		return false
	}
	switch got.t {
	case TypeObject:
		if len(got.o.kvs) != len(want.o.kvs) {
			return false
		}
		for i := range got.o.kvs {
			if got.o.kvs[i].k != want.o.kvs[i].k {
				return false
			}
			if !compareValue(got.o.kvs[i].v, want.o.kvs[i].v) {
				return false
			}
		}
	case TypeArray:
		if len(got.a) != len(want.a) {
			return false
		}
		for i := range got.a {
			if !compareValue(got.a[i], want.a[i]) {
				return false
			}
		}
	case TypeString:
		if got.s != want.s {
			return false
		}
	case TypeNumber:
		// TODO: compare numbers
	case TypeTrue, TypeFalse:
		// TODO: compare bool
	case TypeNull:
		// TODO: compare null
	}
	return true
}

