			json:    `{"key\\\"1": "value1", "key2\\\"": "value2"}`,
			want:    map[string]interface{}{`key"1`: "value1", `key2"`: "value2"},
			wantErr: false,
		},
		{
			name:    "Invalid object",
			json:    `{"key": "value`,
			want:    nil,
			wantErr: true,
		},
		{
			name:    "Missing closing brace",
