			for _, kv := range v.o.kvs {
				switch kv.v.t {
				case TypeString:
					got[kv.k] = kv.v.s
				case TypeNumber:
					var num float64
					json.Unmarshal([]byte(kv.v.s), &num)
					got[kv.k] = num
				case TypeBool:
					var b bool
					json.Unmarshal([]byte(kv.v.s), &b)
					got[kv.k] = b
				case TypeArray:
					got[kv.k] = kv.v.a
				case TypeObject:
					got[kv.k] = kv.v.o
				}
			}
			if !reflect.DeepEqual(got, tt.want) {
				t.Errorf("parseObject() got = %v, want %v", got, tt.want)
			}
		})
	}
}

