				s:   `{"key1": "value1", "key2": 2}`,
				c:   &cache{},
				depth: 0,
			},
			want:    nil,
			wantErr: false,
		},
		{
			name: "nested object",
			args: args{
				s:   `{"key1": {"key2": "value2"}, "key3": [1, 2, 3]}`,
				c:   &cache{},
				depth: 0,
			},
			want:    nil,
			wantErr: false,
		},
		{
