			args: args{
				s:   `{"key\\\"1": "value\\\"2", "key3": [1, 2, 3]}`,
				c:   &cache{},
				depth: 0,
			},
			want:    nil,
			wantErr: false,
		},
	}
	for _, tt := range tests {
