			var stdlibResult map[string]interface{}
			err := json.Unmarshal([]byte(tt.args.s), &stdlibResult)
			if err != nil {
				t.Errorf("json.Unmarshal() error = %v", err)
				return
			}

			got, _, err := parseObject(tt.args.s, tt.args.c, tt.args.depth)
			if (err != nil) != tt.wantErr {
				t.Errorf("parseObject() error = %v, wantErr %v", err, tt.wantErr)
				return
			}

			if !compareValues(got, stdlibResult) {
				t.Errorf("parseObject() result doesn't match stdlib result")
				return
			}
		})
	}
}

func compareValues(v *Value, stdlibValue interface{}) bool {
	switch stdlibValue.(type) {
	case map[string]interface{}:
		o, _ := v.Object()
		for i := 0; i < o.Len(); i++ {
			kv := o.kvs[i]
			if !compareValues(kv.v, stdlibValue.(map[string]interface{})[kv.k]) {
				return false
			}
		}
		return true
	case []interface{}:
		a, _ := v.Array()
		if len(a) != len(stdlibValue.([]interface{})) {
			return false
		}
		for i := 0; i < len(a); i++ {
			if !compareValues(a[i], stdlibValue.([]interface{})[i]) {
				return false
			}
		}
		return true
	case string:
		return v.String() == stdlibValue.(string)
	case float64:
		return v.Float64() == stdlibValue.(float64)
	case bool:
		return v.Bool() == stdlibValue.(bool)
	case nil:
		return v.Type() == TypeNull
	default:
		return false
	}
}

