func compareValues(v1, v2 *Value) bool {
	if v1 == nil && v2 == nil {
		return true
	}
	if v1 == nil || v2 == nil {
		return false
	}
	if v1.t != v2.t {
		return false
	}
	switch v1.t {
	case TypeObject:
		return compareObjects(v1.o, v2.o)
	case TypeArray:
		return compareArrays(v1.a, v2.a)
	case TypeString:
		return v1.s == v2.s
	case TypeNumber:
		return v1.s == v2.s
	case TypeTrue:
		return true
	case TypeFalse:
		return true
	case TypeNull:
		return true
	default:
		return false
	}
}

func compareObjects(o1, o2 Object) bool {
	if len(o1.kvs) != len(o2.kvs) {
		return false
	}
	for i, kv1 := range o1.kvs {
		kv2 := o2.kvs[i]
		if kv1.k != kv2.k {
			return false
		}
		if !compareValues(kv1.v, kv2.v) {
			return false
		}
	}
	return true
}

func compareArrays(a1, a2 []*Value) bool {
	if len(a1) != len(a2) {
		return false
	}
	for i, v1 := range a1 {
		v2 := a2[i]
		if !compareValues(v1, v2) {
			return false
		}
	}
	return true
}

