func TestParseObject_CompareWithStdlib(t *testing.T) {
	tests := []string{
		`{"key1": "value1", "key2": "value2"}`,
		`{"key1": {"nested_key1": "value1", "nested_key2": "value2"}, "key2": "value3"}`,
		`{"key1": ["value1", "value2"], "key2": "value3"}`,
		`{"key1": "value1\\\"value2", "key2": "value3"}`,
	}
	for _, s := range tests {
		t.Run(s, func(t *testing.T) {
			// Parse with fastjson
			v, _, err := parseObject(s, &cache{}, 0)
			if err != nil {
				t.Errorf("parseObject() error = %v", err)
			}

			// Parse with standard library
			var stdlibValue map[string]interface{}
			if err := json.Unmarshal([]byte(s), &stdlibValue); err != nil {
				t.Errorf("json.Unmarshal() error = %v", err)
			}

			// Compare the results
			if !compareValues(v, stdlibValue) {
				t.Errorf("parseObject() results don't match standard library")
			}
		})
	}
}

func compareValues(fastjsonValue *Value, stdlibValue interface{}) bool {
	switch fastjsonValue.t {
	case TypeObject:
		stdlibObject, ok := stdlibValue.(map[string]interface{})
		if !ok {
			return false
		}
		if len(fastjsonValue.o.kvs) != len(stdlibObject) {
			return false
		}
		for i, kv := range fastjsonValue.o.kvs {
			stdlibKey := kv.k
			stdlibValue := stdlibObject[stdlibKey]
			if !compareValues(kv.v, stdlibValue) {
				return false
			}
		}
		return true
	case TypeArray:
		stdlibArray, ok := stdlibValue.([]interface{})
		if !ok {
			return false
		}
		if len(fastjsonValue.a) != len(stdlibArray) {
			return false
		}
		for i, v := range fastjsonValue.a {
			if !compareValues(v, stdlibArray[i]) {
				return false
			}
		}
		return true
	case TypeString:
		stdlibString, ok := stdlibValue.(string)
		if !ok {
			return false
		}
		return fastjsonValue.s == stdlibString
	case TypeNumber:
		stdlibNumber, ok := stdlibValue.(float64)
		if !ok {
			return false
		}
		return fastjsonValue.s == fmt.Sprintf("%f", stdlibNumber)
	case TypeTrue:
		stdlibBool, ok := stdlibValue.(bool)
		if !ok {
			return false
		}
		return stdlibBool == true
	case TypeFalse:
		stdlibBool, ok := stdlibValue.(bool)
		if !ok {
			return false
		}
		return stdlibBool == false
	case TypeNull:
		return stdlibValue == nil
	default:
		return false
	}
}

